import React, { useState, useEffect } from  'react';
import axios from 'axios';
import { Navigate } from 'react-router-dom';
import { makeStyles } from '@mui/styles';
import { Typography, Button, Grid, TextField } from '@mui/material'

import DisplayAppBar from './DisplayAppBar';

export default function HomePage() {
    const [data, setData] = useState([]);

    useEffect(() => {
        axios.get("http://localhost:8000/swimmer/")
        .then(response => {
            console.log(response.data)
            setData(response.data);
        })
        .catch(error => {
            console.log(error);
        })
    }, []);

    return (
        <div>
            <Grid container>
                <Typography variant="h1" color="primary">{data[0].fname}</Typography>
                <Typography variant="h1" color="primary">{data[0].lname}</Typography>
                <Typography variant="h1" color="primary">{data.email}</Typography>
                <Typography variant="h1" color="primary">{data.club}</Typography>
            </Grid>
        </div>
    )
};
